import React, { Component } from "react";

class Form extends Component {
  state = {};

  render() {
    return (
      <div className="col-md-12">
        <div>
          <h3 align="center">Order</h3>
          <Form>
            <div className="row">
              <input type="text">Enter value</input>
            </div>
          </Form>
        </div>
      </div>
    );
  }
}

export default Form;
